import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 23.1-623 Two-Year College Transfer Grant Program; Council regulations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-623.md","filePath":"vacode/23.1-623.md"}'),o={name:"vacode/23.1-623.md"},i=t('<h1 id="§-23-1-623-two-year-college-transfer-grant-program-council-regulations" tabindex="-1">§ 23.1-623 Two-Year College Transfer Grant Program; Council regulations. <a class="header-anchor" href="#§-23-1-623-two-year-college-transfer-grant-program-council-regulations" aria-label="Permalink to &quot;§ 23.1-623 Two-Year College Transfer Grant Program; Council regulations.&quot;">​</a></h1><p>A. The Two-Year College Transfer Grant Program is created to provide financial assistance to eligible students, beginning with the first-time entering freshman class of the fall 2007 academic year, for the costs of attending an eligible institution. Funds may be paid to any eligible institution on behalf of students who have been awarded financial assistance pursuant to § <a href="http://law.lis.virginia.gov/vacode/23.1-624/" target="_blank" rel="noreferrer">23.1-624</a>.</p><p>B. The Council shall adopt regulations for the implementation of the provisions of this article and the disbursement of funds consistent with the provisions of this article that are appropriate to the administration of the Program.</p><p>2007, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0850" target="_blank" rel="noreferrer">850</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0899" target="_blank" rel="noreferrer">899</a>, § 23-38.10:9; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[i];function l(s,c,g,f,h,p){return a(),r("div",null,n)}const u=e(o,[["render",l]]);export{_ as __pageData,u as default};
